css:
.sidebar-github-profile a {
  text-decoration: none;
}
.sidebar-github-profile .logo {
  float: left;
  width: 15px;
  height: 15px;
  opacity: 0.4;
  margin-right: 7.5px;
}
.sidebar-github-profile .repo {
  padding-left: 15px;
  border-left: 1px solid #dddddd;
  margin-left: 7.5px;
  font-size: 12px;
}
.sidebar-github-profile .repo a {
  overflow: hidden;
  text-overflow: ellipsis;
}
.sidebar-github-profile .repo .stars {
  float: right;
  margin-left: 15px;
}
.sidebar-github-profile h2 {
  font-size: 11px;
  font-weight: 600;
  text-transform: uppercase;
  color: rgba(35, 31, 32, 0.5);
  border-bottom: 1px solid #dddddd;
  margin: 2em 0 1em 0;
}
